        Event_Rule_103002 = {
          ContentES = "<Title>Acerca del Teatro inmersivo</>\n1. El Teatro Inmersivo se divide en tres secciones: [Repertorio clásico], [Repertorio destacado] y [Repertorio inmortal]. Completa cada sección para desbloquear la siguiente. El [Repertorio clásico] son desafíos de una sola vez. El [Repertorio destacado] y el [Repertorio inmortal] rotan con las versiones. El [Repertorio inmortal] también ofrece niveles permanentes rejugables tras cumplir condiciones.\n2. Derrota a todos los oponentes dentro del límite de tiempo para completar el nivel. Completar un nivel otorga [Estrellas] y [Talones de entrada]. Las Estrellas desbloquean recompensas por niveles, y los Talones de entrada pueden ser canjeados en la Tienda del Teatro por objetos exclusivos.\"\n3. Los [Repertorios clásicos] y [destacados] tienen dos rondas por etapa: [Odisea del héroe] y [Regreso del héroe]. Debes usar equipos diferentes para cada ronda. Las recompensas finales se basan en las estrellas totales obtenidas en ambas rondas. [Repertorio inmortal] incluye solo [Odisea del héroe].\n4. Cada ronda consta de 5 salas que deben completarse en orden. Completa todas las salas en [Odisea del héroe] y [Regreso del héroe] para desbloquear el siguiente acto. No derrotar al oponente o quedarse sin tiempo en alguna sala impedirá avanzar.\n5. Todos los niveles incluyen [Resonancia de escenario]: Una mecánica única que otorga bonificaciones o penalizaciones durante el combate. Ajusta tu estrategia en consecuencia.",
