        FeeRefund_Rule_Content = {
          ContentES = "Estimados Phoxcazadores,\n\nLa segunda prueba beta cerrada es una prueba de acceso limitado y pago con borrado completo de datos. Durante el período de prueba estarán disponibles recargas dentro del juego, y todo gasto será reembolsado según las reglas indicadas a continuación. Por favor, lee cuidadosamente para asegurarte de reclamar correctamente tus recompensas al lanzamiento.\n\n<Title>Reglas de reembolso de recargas</>\n1. Todos los montos recargados durante la segunda beta cerrada serán reembolsados en la versión oficial de lanzamiento a una tasa fija de: <highlight>¥1 = 10 Gemas de Phoxene</>.\n ① Para la porción de tu recarga total <highlight>hasta ¥2.000</>, recibirás el <highlight>200 %</> del valor equivalente en Gemas de Phoxene.\n ② Para la porción <highlight>de ¥2.001 a ¥5.000</>, recibirás el <highlight>150 %</>.\n ③ Para cualquier porción que <highlight>supere ¥5.000</>, recibirás el <highlight>128 %</>.\n※ Si el reembolso calculado incluye decimales, se redondeará al número entero más cercano.\nEjemplo: \nSi un jugador recarga ¥6.000 durante la prueba, el reembolso se calculará como:\n(¥2.000×10×200 %) + (¥3.000×10×150 %) + (¥1.000×10×128 %) = 97.800 Gemas de Phoxene\n\n2. Los jugadores que compren el <highlight>Pase mensual de Luno, la sirvienta</> durante la segunda beta cerrada recibirán, además del reembolso en Gemas de Phoxene indicado arriba, una duración equivalente de suscripción de forma gratuita al lanzamiento oficial del juego. <highlight>Se reembolsará un máximo de dos compras</>, para un total de 60 días de beneficios. Ten en cuenta que el marco de avatar incluido con el Pase mensual es exclusivo de la beta y no se transferirá.\nEjemplo: \nSi un jugador compra dos Pases mensuales (¥60 en total), recibirá:\n¥60 × 10 × 200 % = 1.200 Gemas de Phoxene, más 60 días de beneficios del Pase mensual al lanzamiento.\n\n3. Las compras de los siguientes ítems durante la segunda beta cerrada contarán para tu monto total de recarga y se reembolsarán según corresponda: Pases de batalla estándar, Pases de batalla prémium, Paquetes de mejora de Pase de batalla, Paquetes de regalo de recarga, Aspectos y montos recargados mediante niveles de recarga. Los reembolsos de Gemas de Phoxene correspondientes se emitirán según las reglas de la sección 1. Ten en cuenta que <highlight>todos los objetos bonus incluidos en estas compras son solo para uso de prueba y no se transferirán al lanzamiento oficial</>.\nEjemplo: \nSi un jugador recarga ¥328 mediante un nivel de recarga, más compra el paquete de regalo [XXX] y un Pase de batalla premium, el gasto total sería: ¥328 + ¥XXX + ¥128 = ¥XXX\n → Al lanzamiento recibirá: ¥XXX × 10 × [tasa de reembolso]% = [monto reembolsado] Gemas de Phoxene\n\n※ Durante la segunda beta cerrada, los jugadores pueden ver su reembolso proyectado mediante: \n[Centro de eventos] → [Vista previa de reembolso para la segunda beta cerrada]\n\n<Title>Entrega de reembolso</>\n1. Las recompensas de reembolso se enviarán mediante correo dentro del juego. Inicia sesión con <highlight>la misma cuenta usada para las recargas durante la prueba</> y asegúrate de tener activada la función de correo del juego para recibir tu reembolso.\n待提供英文\n2. Las recargas realizadas a través del sistema de cuenta oficial solo podrán reclamarse iniciando sesión con ese sistema tras el lanzamiento. Las recargas realizadas a través del sistema de cuenta bilibili solo podrán reclamarse con la misma cuenta bilibili. (Los clientes descargados desde el sitio oficial, TapTap o Haoyou Kuaibao (3839) usan el sistema de cuenta oficial. Los clientes descargados desde el Centro de juegos bilibili usan el sistema de cuenta bilibili.)\n3. Los datos de cuenta se compartirán entre PC, iOS y Android tanto en la beta como en el lanzamiento oficial.\n4. Los jugadores deben iniciar sesión dentro de los 365 días posteriores al lanzamiento oficial para reclamar su reembolso mediante correo del juego.\n<highlight>El correo de reembolso expirará después de este período</>.\n\nAsegúrate de reclamarlo a tiempo.\n待提供英文\n待提供英文",
