        GRADEUP_5102_01 = {
          ContentES = "Al salir del estado [Sigilo] aumenta la Prob. CRIT del arma en #4 durante #3 s.",
          TextMapId = "GRADEUP_5102_01"
        },
        GRADEUP_5102_02 = {
          ContentES = "Cuando [Ojo por Ojo] o [Mordisco Voraz] genera [Púa de Colmillo], hay #2 de probabilidad de activación de generar 1 [Púa de Colmillo] adicional.",
          TextMapId = "GRADEUP_5102_02"
