        },
        GRADEUP_5301_01 = {
          ContentES = "Al usar [Tejido de Crisálida Onírica] y [Fototaxis], restaura #3 de PV Máx. y obtiene un aumento de daño infligido de #2 durante #4 s.",
          TextMapId = "GRADEUP_5301_01"
        },
        GRADEUP_5301_02 = {
          ContentES = "En estado [Deslumbrante], dispara 16 [Polvos Etéreos] cada #7 s. Cuando [Polvo Etéreo] o [Estigma de Polvo] inflige daño, hay una probabilidad de #1 de generar 1 [Fantasma] en la ubicación del objetivo.",
          TextMapId = "GRADEUP_5301_02"
        },
        GRADEUP_5301_03 = {
          ContentES = "[Tejido de Crisálida Onírica] nivel +2; [Resplandor Ámbar] nivel +1.",
          TextMapId = "GRADEUP_5301_03"
        },
        GRADEUP_5301_04 = {
          ContentES = "En estado [Deslumbrante], obtiene [Eclosión]: inmunidad al Aturdimiento al recibir daño, disminuye el daño recibido en #5 y aumenta el rango de recogida automática en 15.",
          TextMapId = "GRADEUP_5301_04"
