        GRADEUP_5301_06 = {
          ContentES = "En estado [Deslumbrante], aumenta la penetración de atributos de Psyche en #6.",
          TextMapId = "GRADEUP_5301_06"
        },
        GRADEUP_5401_01 = {
          ContentES = "Durante [Efusión Esmeralda], el daño infligido del usuario y aliados aumenta en #3.",
          TextMapId = "GRADEUP_5401_01"
