        Mail_Content_100001 = {
          ContentES = "¡Gracias por completar la encuesta! Hemos preparado un regalo para ti~",
          TextMapId = "Mail_Content_100001"
        },
        Mail_Content_100002 = {
          ContentES = "Estimado Phoxcazador,\n\n¡Gracias por tomarte el tiempo de responder nuestra encuesta! Encontrarás tu recompensa adjunta.\nValoramos mucho cada comentario: tus opiniones nos ayudan a mejorar continuamente la calidad y la experiencia del juego.",
          TextMapId = "Mail_Content_100002"
        },
        Mail_Content_100003 = {
          ContentES = "Este es un correo electrónico de prueba que contiene el paquete adicional 130004 (Lote intermedio de Cuña Demoníaca – combate cuerpo a cuerpo).\nExpira en 1 día.",
          TextMapId = "Mail_Content_100003"
        },
        Mail_Content_100005 = {
          ContentES = "Estimado Phoxcazador,\nTus recompensas de evento no reclamadas han sido enviadas a tu buzón. Te deseamos mucho éxito en tus próximos encargos.",
          TextMapId = "Mail_Content_100005"
        },
        Mail_Content_10007 = {
          ContentES = "Estimado Phoxcazador,\n\nAquí están los detalles de tu reembolso de la Segunda Prueba Beta Cerrada:\n• Monto total recargado: <H>{TotalRechargeMoney}CNY</> → Reembolsado como <H>{Phoxene}Gemas de Phoxene</>\n• Reembolso del Pase Mensual: <H>{MonthlyCard} Pase(s)</>\n\nAgradecemos sinceramente tu apoyo a Duet Night Abyss.",
          TextMapId = "Mail_Content_10007"
        },
        Mail_Content_10008 = {
          ContentES = "Estimado Phoxcazador,\n\n¡Gracias por completar la encuesta! Encuentra tu recompensa adjunta.\n\nDamos gran importancia a cada comentario: tus opiniones nos ayudan a mejorar continuamente la calidad y la experiencia del juego.",
          TextMapId = "Mail_Content_10008"
        },
        Mail_Content_10010 = {
          ContentES = "Estás intentando vincular una cuenta. Para garantizar la seguridad de tu cuenta, completa la verificación de identidad. Tu código de verificación: {Code}",
          TextMapId = "Mail_Content_10010"
        },
        Mail_Content_10011 = {
          ContentES = "Estimado Phoxcazador:\nLas recompensas que ganaste a través de Twitch Drops han sido entregadas a tu cuenta del juego.\nPor favor, recíbelas en el archivo adjunto.\n\nGracias por tu apoyo.\n\n— El equipo de Duet Night Abyss",
          TextMapId = "Mail_Content_10011"
        },
        Mail_Content_10012 = {
          ContentES = "Estimado Phoxcazador:\nLas recompensas que ganaste a través de CHZZK Drops han sido entregadas a tu cuenta del juego.\nPor favor, recíbelas en el archivo adjunto.\n\nGracias por tu apoyo.\n\n— El equipo de Duet Night Abyss",
          TextMapId = "Mail_Content_10012"
        },
        Mail_Content_10013 = {
          ContentES = "Un pequeño secreto para ti: ¡hoy es súper importante! Hemos esperado este día por tanto tiempo.\nEn el momento en que el reloj dio las doce, ¡salimos corriendo a conseguir tu regalo! ¡Regateamos con los comerciantes y espantamos a esos ruidosos Filthoids, todo para traerte esta pequeña sorpresa!\nPorque queríamos ser los primeros en decir...\n¡Feliz cumpleaños!\n¡Oh! Y ahora se supone que debes pedir un deseo, ¿verdad? Humm... ¡Que tu nuevo año esté lleno de aventuras que compartamos, más diversión de la que imaginamos, y nuestras historias escritas por toda Atlasia!\n¡Espera, uf! ¡Ese es nuestro deseo! Vamos a empezar de nuevo, rápido, ¡haz un deseo en tu corazón! Sea lo que sea, algún día seguro se hará realidad.\n\n— Con cariño,\nLunos de Atlasia",
          TextMapId = "Mail_Content_10013"
        },
        Mail_Content_10014 = {
          ContentES = "Estimado Phoxcazador,\nHas iniciado sesión correctamente en Lunoloft. Por favor, reclama tu recompensa.",
          TextMapId = "Mail_Content_10014"
        },
        Mail_Content_10016 = {
          ContentES = "Estimado Phoxcazador, \nAdjunto encontrarás el pensamiento de la memoria de Rebecca.",
          TextMapId = "Mail_Content_10016"
        },
        Mail_Content_10021 = {
          ContentES = "Estimado Phoxcazador:\nLas recompensas de este evento han sido entregadas a tu cuenta. Por favor, recíbelas desde tu buzón.\n¡Te deseamos un agradable viaje por Atlasia!",
          TextMapId = "Mail_Content_10021"
        },
        Mail_Content_100301 = {
          ContentES = "Ocurrió un error durante la distribución de recompensas. Las recompensas recuperadas han sido enviadas al inventario",
          TextMapId = "Mail_Content_100301"
        },
        Mail_Content_10031 = {
          ContentES = "Estimado Phoxcazador:\nTu Pase mensual expirará el <H>{Time}</>, por favor reclama tus recompensas a tiempo para no perderlas.",
          TextMapId = "Mail_Content_10031"
        },
        Mail_Content_10032 = {
          ContentES = "Estimado Phoxcazador,\nEl Tomo del bardo de este período expirará el <H>{Time}</>, por favor reclama tus recompensas a tiempo para no perderlas.",
          TextMapId = "Mail_Content_10032"
        },
        Mail_Content_10033 = {
          ContentES = "Estimado Phoxcazador,\nEl evento [{EventName}] concluirá el <H>{Time}</> (hora del servidor). Por favor, reclama tus recompensas a tiempo para no perderlas.",
          TextMapId = "Mail_Content_10033"
        },
        Mail_Content_100401 = {
          ContentES = "Estimado Phoxcazador, el último volumen del Tomo del bardo ya está completo. Todas las recompensas no obtenidas se han enviado a tu correo. ¡No olvides reclamarlas!",
          TextMapId = "Mail_Content_100401"
