        Mail_Content_100402 = {
          ContentES = "Estimado Phoxcazador, tu compra repetida del Tomo del bardo ha sido reembolsada en Phoxene equivalente al valor de tu compra. Gracias por tu paciencia y comprensión. ¡Disfruta del juego!",
          TextMapId = "Mail_Content_100402"
        },
        Mail_Content_10055 = {
          ContentES = "Estimado Phoxcazador,\nLas recompensas de este evento han sido entregadas a tu cuenta. Por favor, recíbelas desde tu buzón.\n¡Te deseamos un agradable viaje por Atlasia!",
          TextMapId = "Mail_Content_10055"
        },
        Mail_Content_10056 = {
          ContentES = "Estimado Phoxcazador,\nGracias por participar en los eventos del Mini Programa. Por favor, reclame sus recompensas de su buzón de correo.",
          TextMapId = "Mail_Content_10056"
        },
        Mail_Content_10058 = {
          ContentES = "Estimados Phoxcazadores, \nGracias por cada “Me gusta” que diste en el concurso de DNArt de creaciones. \n¡Su apoyo hace brillar aún más el esfuerzo de nuestros creadores! \n\n— Equipo de Operaciones Duet Night Abyss",
