        Mail_Content_10059 = {
          ContentES = "Estimado Phoxcazador,\nLas recompensas de este evento han sido entregadas a tu cuenta. Por favor, recíbelas desde tu buzón.\n¡Te deseamos un agradable viaje por Atlasia!",
