        SKILL_20101_DESC = {
          ContentES = "Probabilidad de Activación +<H>#1</>. Cada disparo con esta arma tiene una probabilidad (según su Probabilidad de Activación de Arma) de disparar un proyectil adicional sin consumir munición, que inflige daño de área igual al <H>#2</> del ATQ de esta arma.",
