          TextMapId = "SKILL_20205_DESC"
        },
        SKILL_20301_DESC = {
          ContentES = "Alcance de Explosión +<H>#1</>. Al explotar, los proyectiles se dividen en 6 proyectiles adicionales que explotan e infligen daño. Al derrotar a un objetivo con esta arma, obtienes 1 acumulación que aumenta el daño CRIT en <H>#2</> durante <H>#3</> s, hasta <H>#4</> acumulaciones. El efecto se elimina al cambiar de arma.",
          TextMapId = "SKILL_20301_DESC"
        },
        SKILL_20302_DESC = {
          ContentES = "Multidisparo +<H>#1</>. Cuando un personaje Pyro esquiva, obtiene 1 acumulación que aumenta el Daño de Habilidad y el Daño de Armas a distancia en <H>#2</> durante <H>#3</> s, hasta <H>#4</> acumulaciones.",
