        SKILL_20402_DESC = {
          ContentES = "Prob. CRIT +<H>#1</> Los proyectiles se adhieren al objetivo y explotan tras 3 s de demora. Los proyectiles unidos en la misma posición se acumulan y aumentan el daño y el alcance de la explosión. Con 1/2/3 acumulaciones, inflige <H>#2</>/<H>#3</>/<H>#4</> del daño original.",
          TextMapId = "SKILL_20402_DESC"
        },
        SKILL_20403_DESC = {
          ContentES = "Daño CRIT +<H>#1</>. Los proyectiles disparados siguen la dirección de la mira. Al infligir daño con esta arma, cuanto más lejos esté el objetivo, mayor será el daño, hasta un aumento máximo de <H>#2</>.",
          TextMapId = "SKILL_20403_DESC"
        },
        SKILL_20405_DESC = {
          ContentES = "ATQ del personaje +<H>#1</>. Al cargar, dispara un proyectil especial que avanza lentamente y explota tras un breve retraso, lo que inflige daño de área. Los disparos pueden detonar ese proyectil al impactarlo de forma anticipada. Cuando un personaje Umbro usa su Habilidad Definitiva, obtiene eficiencia de habilidad +<H>#2</> durante <H>#3</> s.",
          TextMapId = "SKILL_20405_DESC"
        },
        SKILL_20501_DESC = {
