        SKILL_20504_DESC = {
          ContentES = "Multidisparo +<H>#1</>. Al infligir daño con esta arma, cuanto menor sea el porcentaje de munición restante en el cargador, mayor será el daño, hasta un máximo de <H>#2</>. Al estar por debajo de <H>#3</> de munición, se alcanza el máximo.",
