        },
        SKILL_20506_DESC = {
          ContentES = "Capacidad del Cargador +<H>#1</>. Al infligir Daño CRIT con esta arma, obtienes 1 acumulación que aumenta la Velocidad de Ataque en <H>#2</> durante <H>#3</> s, hasta <H>#4</> acumulaciones. El efecto se elimina al cambiar de arma.",
          TextMapId = "SKILL_20506_DESC"
        },
        SKILL_20507_DESC = {
          ContentES = "Daño CRIT +<H>#1</>. Los proyectiles que impactan el entorno o recorren cierta distancia regresan a la posición del usuario y aumentan la munición en 1. Cada aumento de la munición máxima de esta arma, el daño infligido aumenta en <H>#2</>, hasta <H>#3</>.",
          TextMapId = "SKILL_20507_DESC"
        },
        SKILL_20509_DESC = {
          ContentES = "Rango de Habilidad +<H>#1</>. Cuando un personaje Lumino inflige daño adicional, hay <H>#2</> de probabilidad de aplicar a los aliados 1 acumulación que aumenta el ATQ en <H>#3</> durante <H>#4</> s, hasta <H>#5</> acumulaciones.",
          TextMapId = "SKILL_20509_DESC"
        },
        SKILL_20510_DESC = {
          ContentES = "Duración de Habilidad +<H>#1</>. Los proyectiles que impactan el entorno o recorren cierta distancia regresan a la posición del usuario y aumentan la munición en 1. Cuando un personaje Lumino activa un efecto extra al infligir daño, obtiene 1 acumulación que aumenta el ATQ en <H>#2</> durante <H>#3</> s, hasta <H>#4</> acumulaciones. Al usar una Habilidad Definitiva, restablece la duración de todas las acumulaciones a <H>#3</> s.",
