          ContentES = "Obtiene el efecto [Efusión Esmeralda]. Durante la duración del efecto, el área cercano se llena de humo alquímico, restaura continuamente PV del usuario y aliados, y aplica continuamente disminución de Velocidad de Movimiento a los enemigos en el área.\nDurante [Efusión Esmeralda], obtiene 2 [Proyectiles de Azoth] por segundo.",
          TextMapId = "SKILL_540101_DESC"
        },
        SKILL_540101_NAME = {
          ContentES = "Efusión Esmeralda",
          TextMapId = "SKILL_540101_NAME"
        },
        SKILL_540102_DESC = {
          ContentES = "Proporciona curación al usuario y aliados y aplica [Fórmula de Purificación]. Inmoviliza brevemente a los enemigos cercanos y les aplica [Fórmula de Decadencia].\nObtiene [Proyectil de Azoth] según la suma total de objetivos aliados y enemigos afectados, hasta un máximo de 12.",
          TextMapId = "SKILL_540102_DESC"
        },
        SKILL_540102_NAME = {
          ContentES = "Síntesis de Repulsión",
          TextMapId = "SKILL_540102_NAME"
        },
        SKILL_540103_DESC = {
          ContentES = "Al poseer [Proyectil de Azoth], aumenta la Probabilidad de Activación de Arma a distancia. Puede almacenar un máximo de 30 [Proyectiles de Azoth]. Cada disparo con Arma a distancia consume 1 [Proyectil de Azoth].",
          TextMapId = "SKILL_540103_DESC"
        },
        SKILL_540103_NAME = {
          ContentES = "Proyectil de Azoth",
          TextMapId = "SKILL_540103_NAME"
        },
        SKILL_540104_DESC = {
