        UI_Warning_Age_Content = {
          ContentES = "1. Duet Night Abyss es un RPG de fantasía de gran libertad, adecuado para jugadores de 16 años en adelante. Se recomienda que los menores jueguen bajo la supervisión de un adulto.\n2. Creado en un escenario ficticio, el juego desarrolla una narrativa rica con interacciones de personajes bien definidas, sin adaptaciones de hechos históricos reales ni problemas contemporáneos.\n3. El juego emplea un sistema de verificación de identidad real para los usuarios. Los menores verificados estarán sujetos a las siguientes regulaciones:\n Ciertos elementos y funciones del juego se pueden comprar. Usuarios menores de 8 años no pueden realizar compras; aquellos mayores de 8 pero menores de 16 años no podrán superar una transacción de 50 RMB ni un total mensual de 200 RMB; para usuarios mayores de 16 pero menores de 18, el límite es de 100 RMB por transacción, con un total mensual máximo de 400 RMB.\n Los servicios de juego estarán disponibles para menores únicamente 1 hora entre las 20:00 y 21:00 los viernes, sábados, domingos y días festivos oficiales.\n4. En Duet Night Abyss, un juego de gran libertad y aventura fantástica, los jugadores encontrarán una gran diversidad de compañeros, enfrentarán varios desafíos y, finalmente, influirán en el curso de la historia. Interactuar con este juego potenciará la rapidez mental y la capacidad de tomar decisiones estratégicas del jugador.",
